import { createIcon } from "../icon/createIcon";

export const MessageSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MessageSolidIcon">
    <path d="M12 1v10H0V1h12zm-1.879 2.303L6.016 6.229 1.881 3.303l-.578.816 4.715 3.336 4.684-3.338-.58-.814z" />
  </svg>,
  "MessageSolid",
  "message solid"
);
